import React from "react";
import { Link } from "react-router-dom";

function Nav() {
  return (
    <nav>
      LOGO
      <ul className="nav-links">
        <li>Homepage</li>
        <li>Shop</li>
        <li>Cart</li>
      </ul>
    </nav>
  );
}

export default Nav;
